const updateJoyStick = (state, joyStickEl, draw, frame) => {
  const movingPart = joyStickEl.findOne("#MOVING_PIECE");
  const containingPart = joyStickEl.findOne("#Base");
  movingPart.cx(containingPart.cx());
  movingPart.cy(containingPart.cy());
  joyStickEl.findOne("#DEGREES_TEXT").x(0);
  if (state.engaged) {
    const moveBy = 20;
    const adjustedDegree = state.degree * -1 + 180;
    const radRatio = Math.PI / 180;
    movingPart.cx(
      containingPart.cx() + Math.cos(adjustedDegree * radRatio) * moveBy
    );
    movingPart.cy(
      containingPart.cy() + Math.sin(adjustedDegree * radRatio) * moveBy
    );
    joyStickEl.findOne(
      "#DEGREES_TEXT"
    ).node.innerHTML = `Джойстик @ ${state.degree}°`;
    joyStickEl.findOne("#DEGREES_TEXT").show();
  } else {
    joyStickEl.findOne("#DEGREES_TEXT").hide();
  }
  joyStickEl.findOne("#BUTTON_TEXT").node.innerHTML = `Батырма: ${state.buttonPressed ? "ON" : "OFF"}`;
};
